import { BannerContainer as Banner } from './Banner-container'
import { connect } from 'react-redux'

const mapStateToProps = state => {
    console.log(state.data.city)
    return {
        onLoad: state.data.city
    }
}

export default connect(mapStateToProps)(Banner)
